
public class Switched {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String a="ab";
		switch(a){
		case "aa":System.out.println("Case 1");
				break;
		case "ab":System.out.println("Case 2");
				break;
		case "ac":System.out.println("Case 3");
				break;	
		case "ad":System.out.println("Case 4");
				break;
		default:System.out.println("Case Default");		
		}
	}

}
